import React, { useState } from "react";
import {
  AppBar,
  Typography,
  Card,
  Paper,
  CardContent,
  TextField,
  Button,
  CardHeader,
  Container,
  FormControl,
  InputLabel,
  Input,
  FormHelperText,
  Divider,
} from "@material-ui/core";
import { blue, cyan ,red} from "@material-ui/core/colors";
import data from "../MOCK_DATA";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles((theme) => ({
  root: {
    position: "relative",
    marginTop: theme.spacing(2),
    padding: `${theme.spacing(2)}px ${theme.spacing(1)}px`,
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    background: cyan[500],
    height: 500,
    width: 500,
  },
  labels: {
    fontWeight: 300,
  },
  email: {
    fontSize: "14px",
    marginTop: "100px",
  },
  password: {
    fontSize: "14px",
    marginTop: "40px",
  },
  button: {
    fontSize: "14px",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    marginTop: "40px"
  },
  cssFocused:{},
  cssOutlinedInput: {
    "&$focused $notchedOutline": {
      borderColor: `${[700]} !important`,
    },
    notchedOutline: {
        borderWidth: '10px',
        borderColor: 'green !important',
        borderRadius: "8px !important",
        border: "1.4px solid !important",
        boxShadow: "1px 2px 20px rgba(169,198,217,0.29457423) !important"
      }
  },
}));
function Login() {
  const classes = useStyles();
  return (
    <Paper elevation={24} className={classes.root}>
      <form>
        <TextField
          fullWidth
          variant="outlined"
          className={classes.email}
          label="Email Address"
          InputLabelProps={{
            classes: {
              root: classes.labels,
            },
          }}
          InputProps={{
            classes: {
              root: classes.cssOutlinedInput,
              focused: classes.cssFocused,
              notchedOutline: classes.notchedOutline,
            },
          }}
        ></TextField>

        <TextField
          fullWidth
          variant="outlined"
          className={classes.password}
          label="Password"
          InputLabelProps={{
            classes: {
              root: classes.labels,
            },
          }}
          InputProps={{
            classes: {
              root: classes.cssOutlinedInput,
              focused: classes.cssFocused,
              notchedOutline: classes.notchedOutline,
            },
          }}
        ></TextField>
        <div className={classes.button}>
          <Button type="submit" variant="contained" color="primary">
            Login
          </Button>
        </div>
      </form>
    </Paper>
  );
}

export default Login;
